import "./LeftPanel.css";

const LeftPanel= () => {
    return(
        <article>
            <header>
                <figure>
                    <img/>
                </figure>
            </header>
            <section>
                <h3></h3>
                <p></p>
            </section>
        </article>
    )
}

export default LeftPanel;
